import { useNavigate } from "react-router-dom";

const Main:React.FC = ()=>{
    let data

    const mainData = async (e:any) => {
        e.preventDefault();
        try{
            const res = await fetch("http://localhost:1234/getData", {
                method:"POST",
                mode:"cors",
                headers: {
                    'Content-Type': 'application/json',
                },
                body: "getData"
            })

            data = await res.json()

            console.log(data)

            return data

        }catch(err){
            console.log("ERROR:",err)
        }
    }

    return (
        <div id="center">helloworld</div>
    )
}

